import logo from './logo.svg';
import './App.css';
import {
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";
import Mainpage from './components/MainPage.jsx';

function App() {
  return (
    <>
      <Link to="/hi">hello</Link>
      {/* 메뉴바 컴포넌트에 Link써서 하자 */}
      <Switch>
        <Route exact path="/hi">
          <Mainpage />
        </Route>
      </Switch>
    </>
  );
}
function hello() {
  return <h2>Hello world</h2>
}

export default App;
